const EstateInfo = ({nextStep, handleChange, values}) => {


	return (
        <form>
		<label>
			Estate type
			<input type="text" placeholder="Estate type" value={values.estatetype} onChange={handleChange('estatetype')} />
		</label>
        </form>

	);
};

export default EstateInfo;
